import{_ as t,a,b as e}from"./chunks/fun_cub_aluminium_frame_for_vtol_mounted.BkZ4sGk0.js";import{_ as r}from"./chunks/px4_frame_generic_standard_vtol.ArpkwYLu.js";import{_ as i,c as o,o as n,ab as l}from"./chunks/framework.CUflZczI.js";const k=JSON.parse('{"title":"FunCub QuadPlane (Pixhawk)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md","filePath":"ko/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md"}'),d={name:"ko/frames_vtol/vtol_quadplane_fun_cub_vtol_pixhawk.md"},u=l('<h1 id="funcub-quadplane-pixhawk" tabindex="-1">FunCub QuadPlane (Pixhawk) <a class="header-anchor" href="#funcub-quadplane-pixhawk" aria-label="Permalink to &quot;FunCub QuadPlane (Pixhawk)&quot;">​</a></h1><p>Fun Cub QuadPlane VTOL은 쿼드콥터로 개조된 표준 테일 플레인 항공기(Multiplex FunCub)입니다.</p><p>주요 정보:</p><ul><li><strong>기체:</strong> Multiplex FunCub</li><li><strong>비행 컨트롤러:</strong> Pixhawk</li></ul><p><img src="'+t+'" alt="Fun Cub VTOL"></p><p>수정되지 않은 Fun Cub는 가격이 비교적 저렴하며, 비행방법도 비교적 쉬운 편입니다. 조립 후의 비행기는 비교적 무겁우며, 비행이 간단하지 않습니다. 비행 기능은 우수하지만, 전진 비행시에는 약 75 %의 추진력이 필요합니다.</p><h2 id="부품-명세서" tabindex="-1">부품 명세서 <a class="header-anchor" href="#부품-명세서" aria-label="Permalink to &quot;부품 명세서&quot;">​</a></h2><p>실제 평면도는 위의 이미지와 비슷합니다 (다른 유사한 모델도 잘 작동합니다. 이것은 Multiplex Fun Cub입니다).</p><p>필요한 최소 장비는 다음과 같습니다.</p><ul><li>Multiplex FunCub (또는 유사 제품)</li><li>Pixhawk 또는 호환 제품</li><li>디지털 풍속 센서</li><li>900kV 모터(예 : Iris 추진 세트 - 모터 및 ESC)</li><li>쿼드 모터용 10 &quot; 프로펠러(10x45 또는 10x47)</li><li>고정익 모터용 10&quot; 프로펠러(10 × 7)</li><li>GPS 모듈</li><li>4S 배터리</li><li>쿼드 모터 장착용 알루미늄 프레임 (10x10mm 사각 튜브, 벽 두께 1mm)</li><li>TOW는 4200mAh 4S 배터리로 중량은 약 2.3kg입니다.</li></ul><h2 id="구조" tabindex="-1">구조 <a class="header-anchor" href="#구조" aria-label="Permalink to &quot;구조&quot;">​</a></h2><p>구조는 아래와 같은 알루미늄 재질로 만들어집니다.</p><p><img src="'+a+'" alt="quad_frame"> <img src="'+e+'" alt="un Cub  vtom 장착 프레임"></p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p>Motor and servo wiring is nearly entirely up to you, but should match the <a href="./../airframes/airframe_reference.html#vtol_standard_vtol_generic_standard_vtol">Generic Standard VTOL</a> configuration, as shown in the airframe reference. The geometry and output assignment can be configured in the <a href="./../config/actuators.html#actuator-outputs">Actuators Configuration</a></p><p>For example, you might wire it up like this example (orientation as if &quot;sitting in the plane&quot;):</p><table><thead><tr><th>포트</th><th>연결</th></tr></thead><tbody><tr><td>MAIN 1</td><td>전방 우측(반시계 방향)</td></tr><tr><td>MAIN 2</td><td>후방 좌측 모터(반시계 방향)</td></tr><tr><td>MAIN 3</td><td>전방 좌측 모터(시계 방향)</td></tr><tr><td>MAIN 4</td><td>후방 우측 모터(시계 방향)</td></tr><tr><td>AUX 1</td><td>좌측 보조익 TODO</td></tr><tr><td>AUX 2</td><td>우측 보조익</td></tr><tr><td>AUX 3</td><td>승강타</td></tr><tr><td>AUX 4</td><td>방향타</td></tr><tr><td>AUX 5</td><td>스로틀</td></tr></tbody></table><p>배선과 설정에 관한 자세한 지침은 다음을 참조하십시오. <a href="./../config_vtol/vtol_quad_configuration.html">표준 VTOL 배선 및 설정</a>. </p><h2 id="기체-설정" tabindex="-1">기체 설정 <a class="header-anchor" href="#기체-설정" aria-label="Permalink to &quot;기체 설정&quot;">​</a></h2><ol><li><p>For <a href="./../config/airframe.html">Airframe</a> select the vehicle group/type as <em>Standard VTOL</em> and the specific vehicle as <a href="./../airframes/airframe_reference.html#vtol_standard_vtol_generic_standard_vtol">Generic Standard VTOL</a> as shown below (do not forget to click <strong>Apply and Restart</strong> in the top).</p><p><img src="'+r+'" alt="QCG - Select Generic Standard VTOL"></p></li><li><p>Configure the outputs and geometry following the instructions in <a href="./../config/actuators.html">Actuators Configuration</a></p></li><li><p>The default parameters are often sufficient for stable flight. For more detailed tuning information see <a href="./../config_vtol/vtol_quad_configuration.html">Standard VTOL Wiring and Configuration</a>.</p></li></ol><p>After you finish calibration the VTOL is ready to fly.</p><h2 id="비디오" tabindex="-1">비디오 <a class="header-anchor" href="#비디오" aria-label="Permalink to &quot;비디오&quot;">​</a></h2><p>@<a href="https://youtu.be/4K8yaa6A0ks" target="_blank" rel="noreferrer">유투브</a></p><h2 id="지원" tabindex="-1">지원 <a class="header-anchor" href="#지원" aria-label="Permalink to &quot;지원&quot;">​</a></h2><p>If you have any questions regarding your VTOL conversion or configuration please visit <a href="https://discuss.px4.io/c/px4/vtol" target="_blank" rel="noreferrer">https://discuss.px4.io/c/px4/vtol</a>.</p>',25),s=[u];function h(p,c,_,f,m,b){return n(),o("div",null,s)}const q=i(d,[["render",h]]);export{k as __pageData,q as default};
